import React from 'react'
import { BrowserRouter,Routes,Route } from 'react-router-dom'
import About from './compoenets/About'

const App = () => {
  return (
    <BrowserRouter>
       <Routes>
           <Route path='/' element={<About/>}/>
       </Routes>
    </BrowserRouter>
  )
}

export default App
